import React from 'react'

const UsersMessages = ({ content, username }) => {
    const user = localStorage.getItem('user')

    return (
        <div>
            {username !== user ? (
               <div className="chat-user-side">
                   <p>{content}</p>
                </div>
            ) : (
                <div className="mt-3 user-side">
                    <h1>user</h1>
                </div>
            )}
       </div>
    )
}

export default UsersMessages
